class Choice extends Component{

    constructor(props){
        super(props);
        this.fname = "./static/choices/" + props.cname;
    }

    options = [
        <label>abelあり </label>
    ];

    render(){
        return (
            <select>
                {this.options}
            </select>
        );
    }
}
export default Choice;
